angular.module('app.services')
    .provider('Camera', function()
    {
        var $ref = this;
        var debugImage = "";

        //---------------------------------------------------
        //Configurable Variable on .config Step
        var _debug = false;

        this.debug = function()
        {
            _debug = true;
            return $ref;
        };

        this.$get = function($log, $cordovaCamera, $q)
        {
            var self = {};

            self.takePicture = function()
            {
                var defer = $q.defer();

                //---------------------------------------
                if (!ionic.Platform.isWebView())
                {

                    if (_debug)
                    {
                        $log.debug("Camera: Test Image");
                    }

                    defer.resolve(debugImage);
                    return defer.promise;
                }

                var options = {
                    quality: 49,
                    destinationType: Camera.DestinationType.DATA_URL,
                    sourceType: Camera.PictureSourceType.CAMERA,
                    allowEdit: false,
                    encodingType: Camera.EncodingType.JPEG,
                    targetWidth: 800,
                    targetHeight: 800,
                    saveToPhotoAlbum: false
                };

                $cordovaCamera.getPicture(options).then(function(imageData)
                {

                    defer.resolve(imageData);

                }, function(err)
                {

                    // ERROR
                    defer.reject(err);

                });

                return defer.promise;
            };

            return self;
        };

    });
